import React from 'react';
import { Card, CardBody, CardTitle, CardSubtitle, Button } from 'reactstrap';
import 'bootstrap/dist/css/bootstrap.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faLink } from '@fortawesome/free-solid-svg-icons';

export default class CopyLink extends React.Component {
	constructor() {
		super();
	}

	render() {
		return (
			<div style={{ display: 'flex', justifyContent: 'space-around', marginTop: '1rem', marginBottom: '5rem' }}>
				<span>
					<FontAwesomeIcon size="1x" style={{ color: 'grey', marginRight: '20px' }} icon={faLink} /> coucou
				</span>
				<Button style={{ borderColor: '#50C3B9', color: '#50C3B9' }} size="sm" outline>
					COPIER
				</Button>
			</div>
		);
	}
}
